// src/ClientF/ClientLister.js
import React, { useState, useEffect } from 'react';
import ClientService from './ClientService';
import '../styles/ListPage.css';

const ClientLister = () => {
    const [clients, setClients] = useState([]);

    useEffect(() => {
        ClientService.getAllClients().then((response) => setClients(response.data));
    }, []);

    return (
        <div className="list-page">
            <ListHeader
                headers={[
                    { key: 'name', label: 'Name' },
                    { key: 'address', label: 'Address' },
                    { key: 'email', label: 'Email' },
                ]}
                onSort={() => {}}
                onFilter={() => {}}
            />
            <div className="table">
                {clients.map((client) => (
                    <div className="table-row" key={client.clientId}>
                        <div>{client.name}</div>
                        <div>{client.address}</div>
                        <div>{client.email}</div>
                        <div>
                            <button onClick={() => ClientService.deleteClient(client.clientId)}>Delete</button>
                            <button onClick={() => window.location.href = `/client/update/${client.clientId}`}>Edit</button>
                        </div>
                    </div>
                ))}
            </div>
        </div>
    );
};

export default ClientLister;
